export function setCookieRaw(n){typeof n=="string"&&(document.cookie=n)}export function getCookie(n){var i,t,r;if(typeof n!="string")return null;for(i=document.cookie.split(";"),t=0;t<i.length;t++)if(r=i[t].split("="),n==r[0].trim())return decodeURIComponent(r[1]);return null}export function removeCookie(n){typeof n=="string"&&(document.cookie=n+"=; max-age=0")}